import "./Card.css";
import React from "react";

const Card = () => {
  return (
    <div className="container">
      <div className="row div-border">
        <div className="col-sm-5">First</div>
        <div className="col-sm-5">Second</div>
      </div>
    </div>
  );
};

export default Card;
